export var SdkError;
(function (SdkError) {
    SdkError["PuzzleWalletNotDetected"] = "Puzzle Wallet not detected!";
    SdkError["NotConnected"] = "dApp not connected to Puzzle Wallet. Call connect first!";
})(SdkError = SdkError || (SdkError = {}));
